import React from 'react'
import { Box, Typography } from '@mui/material'
import CircularProgress from '@mui/material/CircularProgress';
function Loading() {
    return (
        <Box sx={{height:'200px', width: '40%', bgcolor: 'black', m:"auto", mt:20,borderRadius:5 }}>
            <Box sx={{width:'50%', m:"auto", pt:"60px"}} >
                <Typography variant="h6" sx={{ display: {md:"flex"}, color : "white"}}>Loading For Data ...</Typography>
                <CircularProgress sx={{ml:'30%', mt:2}} />
            </Box>
        </Box>
    )
}

export default Loading
